define({"topics" : [{"title":"Processing Mode","href":"datacollector\/UserGuide\/Origins\/HTTPClient.html#concept_erx_tjp_fs","attributes": {"data-id":"concept_erx_tjp_fs",},"menu": {"hasChildren":false,},"tocID":"concept_erx_tjp_fs-d46e64443","topics":[]},{"title":"Actions for Response Statuses","shortdesc":"\n               <p class=\"shortdesc\">By default, the HTTP Client origin processes only responses that include a 2xx         success status code. When the response\n                  includes any other status code, such as a 4xx or 5xx         status code, the origin generates an error and handles the record\n                  based on the error record         handling configured for the stage.\n               </p>\n            ","href":"datacollector\/UserGuide\/Origins\/HTTPClient.html#concept_hqz_pvn_kmb","attributes": {"data-id":"concept_hqz_pvn_kmb",},"menu": {"hasChildren":false,},"tocID":"concept_hqz_pvn_kmb-d46e64465","topics":[]},{"title":"Pagination","href":"datacollector\/UserGuide\/Origins\/HTTPClient.html#concept_edk_j5t_zw","attributes": {"data-id":"concept_edk_j5t_zw",},"menu": {"hasChildren":true,},"tocID":"concept_edk_j5t_zw-d46e64500","next":"concept_edk_j5t_zw-d46e64500",},{"title":"HTTP Method","href":"datacollector\/UserGuide\/Origins\/HTTPClient.html#concept_zyc_53p_fs","attributes": {"data-id":"concept_zyc_53p_fs",},"menu": {"hasChildren":false,},"tocID":"concept_zyc_53p_fs-d46e65250","topics":[]},{"title":"OAuth 2 Authorization","href":"datacollector\/UserGuide\/Origins\/HTTPClient.html#concept_c13_zz1_5y","attributes": {"data-id":"concept_c13_zz1_5y",},"menu": {"hasChildren":true,},"tocID":"concept_c13_zz1_5y-d46e65383","next":"concept_c13_zz1_5y-d46e65383",},{"title":"Logging Request and Response Data","shortdesc":"\n               <p class=\"shortdesc\">The HTTP Client origin can log request and response data to the <span class=\"ph\">Data Collector</span>         log.\n               </p>\n            ","href":"datacollector\/UserGuide\/Origins\/HTTPClient.html#concept_uyw_rct_fdba","attributes": {"data-id":"concept_uyw_rct_fdba",},"menu": {"hasChildren":false,},"tocID":"concept_uyw_rct_fdba-d46e66024","topics":[]},{"title":"Generated Records","shortdesc":"\n               <p class=\"shortdesc\">The HTTP Client origin <span class=\"ph\">generates records based on the responses it                         receives.</span></p>\n            ","href":"datacollector\/UserGuide\/Origins\/HTTPClient.html#concept_etl_bsh_l2b","attributes": {"data-id":"concept_etl_bsh_l2b",},"menu": {"hasChildren":false,},"tocID":"concept_etl_bsh_l2b-d46e66214","topics":[]},{"title":"Data Formats","href":"datacollector\/UserGuide\/Origins\/HTTPClient.html#concept_mnv_s5r_35","attributes": {"data-id":"concept_mnv_s5r_35",},"menu": {"hasChildren":false,},"tocID":"concept_mnv_s5r_35-d46e66413","topics":[]},{"title":"Configuring an HTTP Client Origin","href":"datacollector\/UserGuide\/Origins\/HTTPClient.html#task_akl_rkz_5r","attributes": {"data-id":"task_akl_rkz_5r",},"menu": {"hasChildren":false,},"tocID":"task_akl_rkz_5r-d46e66617","topics":[]}]});